public struct ErasedOpaqueEquatable {
    var isEqualTo: (Any) -> Bool

    init() {
        isEqualTo = { _ in false }
    }

    init<T: Equatable>(value: T) {
        isEqualTo = { value == $0 as? T }
    }
}

// end user interface
public func anyIsEqual(_ a: Any, _ b: Any) -> Bool {
    guard let a = a as? MaybeEquatable else { return false }
    return a.isEqual(to: b)
}

