import Foundation

public func isEqual(_ lhs: Any, _ rhs: Any) -> Bool {
    let lhsType = type(of: lhs)
    let rhsType = type(of: rhs)
    guard lhsType == rhsType else { return false }
    guard let witnessTable = swift_conformsToProtocol(lhsType, EquatableProtocolDescriptor) else { return false }
    let theType = unsafeBitCast(lhsType, to: UnsafeRawPointer.self)
    return withUnsafePointer(to: lhs) { lhsPtr in
        withUnsafePointer(to: rhs) { rhsPtr in
            AnyEquatable_internalIsEqual(lhsPtr, rhsPtr, theType, witnessTable)
        }
    }
}

@_silgen_name("swift_conformsToProtocol")
func swift_conformsToProtocol(_: Any.Type, _: UnsafeRawPointer) -> UnsafeRawPointer?

func load<T>(symbol: String) -> T {
    if let sym = dlsym(dlopen(nil, RTLD_LAZY), symbol) {
        return unsafeBitCast(sym, to: T.self)
    }
    let errorString = String(validatingUTF8: dlerror())
    fatalError("Finding symbol \(symbol) failed: \(errorString ?? "unknown error")")
}

let AnyEquatable_internalIsEqual: @convention(c) (UnsafeRawPointer, UnsafeRawPointer, UnsafeRawPointer, UnsafeRawPointer) -> Bool = load(symbol: "AnyEquatable_internalIsEqual")
let EquatableProtocolDescriptor: UnsafeRawPointer = load(symbol: "$sSQMp")

@_silgen_name("AnyEquatable_internalIsEqual")
func _internalIsEqual<T: Equatable>(_ lhs: T, rhs: T) -> Bool {
    return lhs == rhs
}
